import {
  BrowserRouter as Router,
  Route,
  Routes,
} from "react-router-dom";
import SignInPage from "./pages/SignInPage";
import Navbar from "./components/Navbar";
import Home from "./pages/Home";
import SignUpPage from "./pages/SignUpPage";
import Admin from "./pages/Admin";
import AdminSideBar from "./components/AdminSideBar";

function App() {
  return (
    <div>
      <Router>
        <Navbar />
        <Routes>
          <Route
            path="/"
            exact
            element={<SignInPage />}
          />
          <Route
            path="/home"
            exact
            element={<Home />}
          />
          <Route
            path="/sign-up"
            exact
            element={<SignUpPage />}
          />
          <Route path="/admin">
            <div>
              <AdminSideBar />
              <Routes>
                <Route
                  path="/"
                  element={<Admin />}
                />
              </Routes>
            </div>
          </Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
